import React, { Component } from "react";

const devCardIcon = {
  DevCard: function card(props) {
    return (
      <div>
        <h1>{this.props.name}</h1>
        <i>{this.props.icon}</i>
      </div>
    );
  }
};

export default devCardIcon;
